import React from "react";
import "../styles/HomePage.css"

function HomePage() {
  return (
    <>
      <div className="header-container">
        <h1>Hi! I'm Alba Arenas</h1>
        <p>I'm a Frontend Developer</p>
      </div>
    </>
  );
}

export { HomePage };
